sys_variable_value.value:
(function execute(inputs, outputs) {
    var gdt = new GlideDateTime();
    var dT=inputs.unixtime;
    gdt.setNumericValue(dT*1000);

    // var d=new Date(dT*1000);
    outputs.odate=gdt;
})(inputs, outputs);

